  false,\n\t\"url\": null,\n\t\"notes\": \"The Great River and Clarence Cannon NWRs
  Habitat Management Plan provides a long-term vision and specific guidance on managing
  habitats for the resources of concern at Great River and Clarence Cannon NWRs, to
  facilitate continuity in management programs. Refuge background, resources of concern,
  and habitat management goals and objectives are discussed. Management strategies
  and prescriptions then identify how and the specific means by which management and
  monitoring strategies will be implemented. Appendices follow.\",\n\t\"owner_org\":
